import React, { useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import { Link } from "react-router-dom";

const useStyles = makeStyles({
  root: {
    minWidth: 275,
    maxWidth: 1000,
    minHeight: 400,
  },

  title: {
    fontSize: 30,
    fontWeight: "bold",
    paddingLeft: 180,
  },

  pos: {
    marginBottom: 12,
  },
  span: {
    paddingLeft: 100,
  },
  note: {
    color: "red",
  },
});

function BookingScreen(props) {
  const classes = useStyles();
  const [name, setName] = useState("");
  const [mobile, setMobile] = useState("");
  const [idproof, setIdproof] = useState("");
  const [idproofnumber, setIdproofnumber] = useState("");
  const [birthdate, setBirthdate] = useState("");
  const [age, setAge] = useState("");
  const [sidediseases, setsidediseases] = useState("");

  const [hoslocation, setHoslocation] = useState("");

  const submitHandler = () => {};

  return (
    <div className="form-topview">
      <div className="form-maindiv">
        <Card className={classes.root}>
          <CardContent>
            <Typography
              className={classes.title}
              color="textSecondary"
              gutterBottom
            >
              Register For Vaccination
            </Typography>

            <div className="form-midview">
              <p className="pnote">
                <span className={classes.note}>Note: </span> Your Photo ID will
                be verified at the time of your vaccination appointment. Please
                provide the details <br />
                <span className={classes.span}>
                  of the Photo ID you will carry for vaccination.Otherwise you
                  will not be eligible for vaccination.
                </span>
              </p>
              <form className="form" onSubmit={submitHandler}>
                <div>
                  <label htmlFor="name">Name</label>
                  <input
                    type="text"
                    id="name"
                    value={name}
                    placeholder="Enter name"
                    required
                    onChange={(e) => setName(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="mobile">Mobile Number</label>
                  <input
                    type="text"
                    id="mobile"
                    value={mobile}
                    placeholder="Enter Mobile Number"
                    required
                    onChange={(e) => setMobile(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="birthdate">Birth Date </label>
                  <input
                    type="text"
                    id="birthdate"
                    value={birthdate}
                    placeholder="DD.MM.YYYY"
                    required
                    onChange={(e) => setBirthdate(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="age">Age</label>
                  <input
                    type="text"
                    id="email"
                    value={age}
                    placeholder="Enter Age"
                    required
                    onChange={(e) => setAge(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="idproof">Photo ID Proof</label>
                  <select
                    id="idproof"
                    value={idproof}
                    onChange={(e) => setIdproof(e.target.value)}
                  >
                    <option value="">Select Photo ID Document</option>
                    <option value="1">Adhar Card</option>
                    <option value="2">Pan Card</option>
                    <option value="3">Voter ID Card</option>
                    <option value="4">Passport Number (Indians)</option>
                    <option value="5">Passport Number (Foreigners)</option>
                  </select>
                  <input
                    type="text"
                    id="idproofnumber"
                    value={idproofnumber}
                    placeholder="Enter Photo ID Number"
                    required
                    onChange={(e) => setIdproofnumber(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="sidediseases">
                    Other Diseases (*if you have any other diseases please
                    mention here){" "}
                  </label>
                  <input
                    type="text"
                    id="idproofnumber"
                    value={sidediseases}
                    placeholder="Mention Diseses"
                    required
                    onChange={(e) => setsidediseases(e.target.value)}
                  ></input>
                </div>
                <label htmlFor="idproof">Photo ID Proof</label>
                <select
                  id="hoslocation"
                  value={hoslocation}
                  onChange={(e) => setHoslocation(e.target.value)}
                >
                  <option value="">Select Vaccination Centers Nearby</option>
                  <option value="1">Adhar Card</option>
                  <option value="2">Pan Card</option>
                  <option value="3">Voter ID Card</option>
                  <option value="4">Passport Number (Indians)</option>
                  <option value="5">Passport Number (Foreigners)</option>
                </select>

                <div>
                  <label />
                  <button className="primary" type="submit">
                    Register
                  </button>
                </div>
                <div>
                  <label />
                </div>
              </form>
            </div>
          </CardContent>
        </Card>
      </div>
    </div>
  );
}

export default BookingScreen;
